import React from 'react';

const Results = (searchResults) => {
    let id;
    let shipping;

    let results = searchResults.map((data) => {
        id = data.label_id;
        shipping = data.shipping_tracking_code
    })

    return (
        <div className="search-result">
            <table>
                <thead>
                <tr>
                    <th>Kit ID</th>
                    <th>Shipping Number</th>
                </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{id}</td>
                        <td>{shipping}</td>
                    </tr>
                </tbody>

            </table>
        </div>
    );
}

export default Results;
